Facility chracteristics:

The aim of the Project is "Integrated development of the Murmansk transport hub. Objects of federal property. Stage I - Railway line - Vykhodnoy station - bridge crossing over the Tuloma river - Murmashi station 2 - Lavna station (Murmansk region: Kolsky district and Murmansk (areas of the territory and adjacent water area on the western coast of the Kola Bay) "is the creation of transport infrastructure on the Western coast of the Kola Bay. Railway transport facilities include:

new railway stations Murmashi 2, Promezhutochnaya, Lavna; block post 9 km, railway Vykhodnoy station (reconstruction);

new electrified railway connecting track of general use from st. Murmashi 2 to st. Lavna with signaling and communication device;

new railway bridge over the river. Tuloma (Kola Bay);

a new electrified railway line from the Murmashi-2 station along a new railway bridge over the river. Tuloma (Kola Bay) before joining the existing railways. public roads in the area of ​​Vykhodnoy station.

Construction length of railway lines of st. Vykhodnoy - st. Lavna - 49.71 km, operational length - 45.48 km.

The bridge as part of the railway bridge crossing over the Kola Bay has a total length of 881.9 m between the axles of the supports (out of class). The underbridge dimension of the bridge is 34 m.
